import React from 'react';
import { Link } from 'react-router-dom';

export const Post = () => {
    return (
        <div class="container-fluid">
        <nav class="navbar navbar-light bg-light">
            <div class="container-fluid">
                <Link to="/" class="navbar-brand">
                Home
                </Link>
            </div>
        </nav>
        </div>
    );
}
